    public static Asset load(String contractAddress, Client client, CryptoKeyPair credential) {
        return new Asset(contractAddress, client, credential);
    }

    public static Asset deploy(Client client, CryptoKeyPair credential, String contractPath)
            throws ContractException {
        return deploy(
                Asset.class,
                client,
                credential,
                getBinary(client.getCryptoSuite()),
                getABI(),
                null,
                contractPath);
    }

